package com.javatuttorial;

public class OperasiPerbandingan {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int value1 = 100;
		int value2 = 100;
		
		System.out.println(value1 > value2);
		System.out.println(value1 < value2);
		System.out.println(value1 >= value2);
		System.out.println(value1 <= value2);
		System.out.println(value1 == value2);
		System.out.println(value1 != value2);
	}

}
